// PermanentDrawer.js or wherever you set up the sidebar

import React from 'react';
import { useAuth } from '../context/authContext';
import { useNavigate } from 'react-router-dom';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Typography from '@mui/material/Typography';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import { red } from '@mui/material/colors';
import MainContent from './components/MainContent'; // make sure to adjust the import path as necessary

export default function PermanentDrawer() {
  const drawerWidth = 240;
  const { logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = async () => {
    await logout();
    navigate('/');
  };

  return (
    <Box sx={{ display: 'flex', height: '100vh' }}>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box' },
        }}
      >
        <Box sx={{ overflow: 'auto' }}>
          <Typography variant="h6" noWrap component="div" sx={{ p: 2 }}>
            Classes
          </Typography>
          {/* Additional sidebar content here */}
        </Box>
      </Drawer>
      <MainContent>
        {/* Any specific content you want to pass can go here, or it defaults to the welcome message */}
      </MainContent>
    </Box>
  );
}
